import React from 'react';

interface ItemProps {
    name:string,
    team: number,
    email:string,
    children?:any
  }
const Item = (props: ItemProps) => (
        <div className="Item" >
            <p><b>Name:</b> {props.name}, Team: {props.team}</p>
            <p><b>Email:</b> {props.email}</p>
        </div>
)
export default Item;
